import React from 'react';
import Microproject from './Microproject.js';
import './Fun.css';

const projects = [
  {
    picture: "http://placekitten.com/g/100/100",
    placeholder: "placeholder",
    info: "tiny rocket game"
  },
]

function Fun() {
  return (
    <section className="fun">
      <h2>Fun things</h2>
      <Microproject 
        picture = "http://placekitten.com/g/100/100"
        placeholder = "placeholder"
        info = "tiny rocket game"
      />
    </section>
  )
}


export default Fun;
